import mixin from 'BlockChain-ui-privatization/PC/common-mixin/modules/coTrade/tradingView/tradingView';
import 'BlockChain-ui-privatization/PC/common-mixin/modules/coTrade/tradingView/tradingView.styl';
import Echarts from '@/components/modules/coTrade/echarts/index.vue';
import tabs from '@/components/modules/spotTrade/tab.vue';
import timeSelect from '../select.vue'

export default {
  mixins: [mixin],
  components: {
    tabs,
    timeSelect,
    Echarts,
  },
  data() {
    return {
      chartTabs: [
        { label: this.$t('pageTitle.priceChart'), value: 'price'},
        { label: this.$t('pageTitle.deepChart'), value: 'deep'},
      ],
      activeChart: 'price',
      timeLabel: '30min'
    }
  },
  mounted() {
    this.init();
  },
  destroyed() {
    this.$bus.$off('SYMBOL_LIST_ALL');
    // 监听 WebSocket 链接成功
    this.$bus.$off('WEBSOCKET_ON_OPEN');
    // 获取 当前选中的货币对
    this.$bus.$off('SYMBOL_CURRENT');
  },
  beforeDestroy() {
    this.MywebSocket = false;
  },
  methods: {
    handlerClickChart(value) {
      if (value === 'price') {
        // price chart
        this.switchChartType(1)
      } else {
        // deep chart
        this.switchChartType(2)
      }
    }
  }
};
